3.1.2.1 Considerando que há uma complexidade que merece atenção para se aumentar o nível de Qualidade do Processamento do Faturamento, tendo em vista que várias áreas fazem parte do processo de trabalho, o que envolve forte sincronia de todas as áreas que participam dos processos de faturamento, ou seja, a Recepção, a Urgência e Emergência, as Unidades de Internação, o Centro Cirúrgico, as Unidades de SADT, a Farmácia etc.
3.1.8. O Diagnóstico será realizado com vista a melhorar a capacidade produtiva dos envolvidos no processo de faturamento, tais como:

Velocidade do processamento do faturamento;

Qualidade do processamento do faturamento;

Nível de informatização;

Efetividade do faturamento;

Padronização de processos;

Cultura de gestão por resultados e metas;

Treinamento de servidores.

3.1.9. Para que essas premissas possam atingir êxito na realização é necessária uma organização de sistematização, dando uma qualificação dos processos de trabalho em saúde, considerando-as atividades de gestão do sistema de saúde e de gestão do cuidado, não só no nível local, mas também nos municípios do Estado.
